              secondaryText="I'll be in your neighborhood doing errands this…"
            />
            <ListItem
              title="Inbox"
              leading={<Icon name="account" size={24} />}
              trailing={(props) => <Icon name="chevron-right" {...props} />}
              secondaryText="I'll be in your neighborhood doing errands this…"
            />
          </Box>
        </ScrollView>
      </SafeAreaView>

      {/* Footer */}
      <View
        style={{
          flexDirection: 'row',
          justifyContent: 'space-between',
          padding: 5,
        }}
      >
        <BorderlessButton
          style={{
            alignItems: 'center',
            width: '49%',
            padding: 10,
            backgroundColor: `red`,
            borderRadius: 8,
            marginVertical: 10,
          }}
          onPress={() => navigate('Galeria')}
        >
          <Icon name="account" size={24} />
        </BorderlessButton>
      </View>
      <Box
        style={{
          alignItems: 'flex-end',
          padding: 8,
          backgroundColor: 'transparent',
          position: 'absolute',
        }}
      >
        <Stack fill center spacing={4}>
          <FAB
            onPress={handleNavigationForm}
            icon={(props) => <Icon name="plus" {...props} />}
          />
        </Stack>
      </Box>
    </Box>
  );
};

export default Home;
